import { Typography } from "@mui/material";
import React from "react";

const AddMovie = () => {
  return (
    <div>
      <form>
        <Box
          width={"50%"}
          padding={10}
          margin="auto"
          display={"flex"}
          flexDirection="column"
          boxShadow={'10px 10px 20px #ccc'}
        >
            <Typography textAlign={'center'} variant="h5" fontFamily={'verdana'}></Typography>
        </Box>
      </form>
    </div>
  );
};

export default AddMovie;
